INSERT INTO `tbl_faqs` (`id`,`question`,`content`,`status`,`created_time`,`updated_time`) VALUES 
 (1,'How to do Free Registration?','<p dir=\\\"ltr\\\">Manashaadi.com, offer Free Registration &quot;www.manashaadi.com/Free-Register&quot;</p>\\r\\r<p dir=\\\"ltr\\\">Please enter EMAIL-ID,PASSWORD,MOBILE,etc.... and few more details. click on &quot;Register Free&quot; button and you will have to enter on a couple of pages the detaiils of the person intending to get married. ManaShaadi.com will be generated &quot;ManaShaadi-ID&quot; for future references and login purposes to meet potential life partner.</p>\\r',1,'2019-01-29 14:37:02','2019-02-14 15:55:58'),
 (9,' Forgot my Manashaadi ID / Password. What should I do?','<p dir=\\\"ltr\\\">You can retrieve your Manashaadi ID / Password by clicking on Forgot Password link in login page and enter your E-mail ID. We will send you an e-mail with your &#39;Manashaadi ID&#39; and &#39;Password&#39; immediately. Your E-mail ID should be the one given in your profile.</p>\\r',1,'2019-02-14 15:59:35','2019-02-14 16:01:01'),
 (6,'Can i use same Email-ID for multiple Registrations?','<p style=\\\"text-align:justify\\\">No, you cannot use same Email-ID for multiple Registrations. We are allowing unique email</p>\\r',1,'2019-01-29 14:41:50','2019-02-14 15:56:20'),
 (7,'How do I edit My Profile?','<p style=\\\"text-align:justify\\\">After login &quot;www.manashaadi.com/login.php&quot; you can find the &quot;Edit Profile&quot; option</p>\\r',1,'2019-01-29 14:42:11','2019-02-14 15:58:23'),
 (8,'How Do I login in?','<p dir=\\\"ltr\\\">Log in from the Home page and enter your ManaShaadi ID or e-mail ID and password into the respective boxes at the top band and click Login button.</p>\\r',1,'2019-02-14 15:59:07','0000-00-00 00:00:00'),
 (10,'What is a Partner preference?','<p>Partner Preference is a feature that helps you define your ideal spouse and set your suitability criteria. You will be intimated by Personally everyday about new profiles matching your criteria</p>\\r',1,'2019-02-14 16:01:39','0000-00-00 00:00:00'),
